import React from 'react';
import FormCours from './components/formCours';
import CoursList from './components/coursList';
import './App.css';

class App extends React.Component{
  render()
  {
  return (
    <section className="App">
      <h1>Ajouter cours</h1>
      <FormCours />
      <CoursList />
    </section>
  );
  }
}

export default App;
